Description:
Situated in the Arlington Medical District, this property is close to the city’s most popular attractions. Arlington Museum of Art, Six Flags Over Texas, and Hurricane Harbor, one of the area’s largest waterparks, are all just a short drive away. The area also boasts plenty of restaurants, from fast and casual to fine dining, as well as several popular retail destinations. Whether you are traveling for business or pleasure, you’ll be close to it all!

This property offers spacious accommodations and all of the amenities today’s modern traveler would expect. Start your day with the free breakfast, complete with a make-your-own waffle bar. Venture outside to relax by the pool or have a snack in the picnic area. You can even fit in a workout at the fitness center. Your four-legged friend is also welcome at this pet-friendly property. A business center, free WiFi, and parking round out the list of amenities that will help make your stay comfortable and relaxing.

THE UNITS

These are 2 separate units located up close or right next to each other. The price is for BOTH units. All private units are located in a hotel-style property.

Each 450sf Double Queen Suite features:
- 2 Queen beds;
- Sofa bed;
- Daily housekeeping;
- Coffee maker, mini-fridge, microwave;
- All linens, towels, bathroom essentials are provided. You don’t need to bring a thing!!
- Perfect unit for groups or families!

THE PROPERTY

Our family-friendly property provides the following on-site amenities: 
- 24/7 Front desk and Security;
- Outdoor swimming pool 10:00 AM - 10:00 PM;
- Loungers by the pool;
- On-site restaurant and bar;
- Business center;
- Vending machines;
- Mini-market on site;
- Fitness center is open from 10:00 AM - 10:00 PM;
- Complimentary hot breakfast from 6:00 AM - 9 :00AM Mon - Fri; 7:00 AM - 10:00 AM Saturdays;
- Up to 2 pets (25lbs each) are allowed for $50 for the first night and $10 for each additional night;
- Parking is available on the property and is free of cost (for 1 ca

